  }

  return (
    <div>
      <input
        type='text'
        onChange={(event)=>setUsername(event)}
        value={username}
        placeholder='username'
      />
      <input
        type='text'
        onChange={(event)=>setPassword(event)}
        value={password}
        placeholder='password'
      />
    </div>
  );
}

export default Login;
